import './App.css';
import ListaUsuarios from './ListaUsuarios';
import AgregarUsuarios from './AgregarUsuario';
import EditarUsuarios from './EditarUsuario';
import {BrowserRouter, Router, Route} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <h1>Crud mern stack render2web.com</h1>
      <BrowserRouter>
        <Route path="/" element={<ListaUsuarios/>} exact ></Route>
        <Route path="/agregarusuario" element={ <AgregarUsuarios/> } exact></Route>
        <Route path="/editarusuario" element={ <EditarUsuarios/> } exact></Route>
      </BrowserRouter>

    </div>
  );
}

export default App;
